import styled, { keyframes } from "styled-components";

function Animation() {
  return <Box></Box>;
}

export default Animation;

const boxAnimation = keyframes`
  0% {
    left: 20px;
    background: red;
  }
  16.6666667% {
    left: 420px;
    background: orange;
  }
  33.3333333% {
    left: 20px;
    background: yellow;
  }
  50% {
    left: 420px;
    background: green;
  }
  66.6666667% {
    left: 20px;
    background: blue;
  }
  83.3333333% {
    left: 420px;
    background: navy;
  }
  100% {
    left: 20px;
    background: purple;
  }
`;

const Box = styled.div`
  width: 100px;
  height: 100px;
  background: red;
  border-radius: 0%;
  position: absolute;
  top: 20px;
  left: 20px;
  animation: ${boxAnimation} 3s 0s infinite linear alternate;
`;
